INSERT INTO `product` (`id`, `name`, `price`, `description`, `category_id`, `availability_id`) VALUES
(1, 'iPhone 12 mini', 3399, 'iPhone 12 mini packs big features in a 5.4-inch design\r\n        <ol>\r\n            <li>A beautifully bright and compact Super Retina XDR display. Ceramic Shield with four times better drop performance.</li>\r\n            <li>Incredible low-light photography with Night mode on all cameras. Cinema-grade Dolby Vision HDR video recording, editing and playback. Powerful A14 Bionic chip. And new MagSafe accessories for easy attachment and faster wireless charging.</li>\r\n            <li>It’s big news for mini.</li>\r\n        </ol>', 1, 1),
(2, 'iPhone 12', 3899, 'iPhone 12. Beautifully bright 6.1-inch Super Retina XDR display.\r\n        <ol>\r\n            <li>\r\n                Ceramic Shield with four times better drop performance.\r\n            </li>\r\n            <li>\r\n                Incredible low-light photography with Night mode on all cameras. Cinema-grade Dolby Vision video recording, editing and playback. Powerful A14 Bionic chip. And new MagSafe accessories for easy attachment and faster wireless charging.\r\n            </li>\r\n            <li>\r\n                Let the fun begin\r\n            </li>\r\n        </ol>', 1, 1),
(3, 'iPhone 12 Pro', 4899, 'iPhone 12 Pro. Beautifully bright 6.1-inch Super Retina XDR display.\r\n        <ol>\r\n            <li>\r\n                Ceramic Shield with four times better drop performance.\r\n            </li>\r\n            <li>\r\n                Incredible low-light photography with a new Pro camera system and 4x optical zoom range. Cinema-grade Dolby Vision video recording, editing and playback. Night mode portraits and next-level AR experiences with the LiDAR Scanner. Powerful A14 Bionic chip. And new MagSafe accessories for easy attachment and faster wireless charging.\r\n            </li>\r\n            <li>\r\n                For infinitely spectacular possibilities.\r\n            </li>\r\n        </ol>', 1, 1),
(4, 'iPhone 12 Pro Max', 5299, 'iPhone 12 Pro Max. Larger 6.7-inch Super Retina XDR display.\r\n        <ol>\r\n            <li>\r\n                Ceramic Shield with four times better drop performance.\r\n            </li>\r\n            <li>\r\n                Incredible low-light photography with the best Pro camera system on an iPhone, and 5x optical zoom range. Cinema-grade Dolby Vision video recording, editing and playback. Night mode portraits and next-level AR experiences with the LiDAR Scanner. Powerful A14 Bionic chip. And new MagSafe accessories for easy attachment and faster wireless charging.\r\n            </li>\r\n            <li>\r\n                For infinitely spectacular possibilities\r\n            </li>\r\n        </ol>', 1, 1),
(5, 'iPad Mini', 1699, 'The beloved 7.9-inch iPad mini is more capable than ever.1 It features the A12 Bionic chip with Neural Engine, which uses real-time machine learning to transform the way you experience photos, gaming, augmented reality (AR) and more. A beautiful Retina display with True Tone for easier viewing in all kinds of lighting environments. Support for Apple Pencil.2 Wi-Fi and 4G LTE Advanced.3 An 8-megapixel back camera and 7‐megapixel FaceTime HD camera. As well as all-day battery life,4 Touch ID and over a million iPad apps on the App Store — in an iPad that fits in one hand.', 2, 1),
(6, 'iPad Pro 12.9-inch (4th generation) WiFi + Cellular', 5049, 'The 12.9-inch iPad Pro features an immersive, edge-to-edge Liquid Retina display.1 The two pro cameras, Wide and new Ultra Wide, combined with the all-new LiDAR Scanner enable entirely new experiences in the next generation of augmented reality (AR) apps. A12Z Bionic chip for powering essential apps and graphics-intensive games. Support for the new Magic Keyboard with trackpad2 and Apple Pencil.2 Faster Wi-Fi and LTE.3 All-day battery life.4 And access to millions of apps on the App Store to transform iPad Pro into anything you need, anywhere you need it.', 2, 1),
(7, 'iPad Air (4th Generation) WiFi + Cellular NEW', 3149, 'The all-new iPad Air. It’s more versatile than ever. The stunning 10.9-inch Liquid Retina display with wide colour lets you see photos, videos and games in vivid, true-to-life detail.1 It features the A14 Bionic chip with Neural Engine, delivering power and advanced machine learning capabilities to edit a 4K video, create a beautiful presentation, design a 3D model and do all of these things with ease. And now with support for Magic Keyboard and Apple Pencil (2nd generation),2 fast, easy and secure Touch ID, a 12-megapixel back camera and 7-megapixel FaceTime HD camera, USB-C connector for charging and accessories, all-day battery life,3 fast Wi-Fi 6 and Gigabit-class LTE.4 With iPad Air, you have the power to bring your ideas to life.', 2, 1),
(8, 'iPad (8th Generation) WiFi + Cellular NEW', 1999, 'The new iPad. It’s your digital notebook, mobile office, photo studio, gaming console and personal cinema. With the A12 Bionic chip that can easily power essential apps and immersive games. So you can edit a document while researching on the web and making a FaceTime call to a colleague at the same time. Apple Pencil makes note-taking with iPad a breeze.1 Attach a full‑sized Smart Keyboard for comfortable typing.1 And go further with Wi-Fi and Gigabit-class LTE,2 and all-day battery life.3', 2, 1),
(9, 'MacBook Air (M1 chip) NEW', 4399, 'Apple’s thinnest and lightest notebook gets supercharged with the Apple M1 chip. Tackle your projects with the blazing-fast 8-core CPU. Take graphics-intensive apps and games to the next level with an up to 8-core GPU. And accelerate machine learning tasks with the 16-core Neural Engine. All with a silent, fanless design and the longest battery life ever — up to 18 hours.1 MacBook Air. Still perfectly portable. Just a lot more powerful.', 3, 1),
(10, 'MacBook Pro (13-inch, M1 chip) NEW', 5599, 'The Apple M1 chip redefines the 13-inch MacBook Pro. Featuring an 8-core CPU that flies through complex workflows in photography, coding, video editing and more. Incredible 8-core GPU that crushes graphics-intensive tasks and enables super-smooth gaming. An advanced 16-core Neural Engine for more machine learning power in your favourite apps. Super-fast unified memory for fluid performance. And the longest-ever battery life in a Mac at up to 20 hours.2 It’s Apple’s most popular pro notebook. Way more performance and way more pro.', 3, 1),
(11, '27-inch iMac with Retina 5K display', 7999, 'iMac performance is at an all-time high with tenth-generation Intel Core processors, powerful AMD Radeon Pro 5000 series graphics, ultra-fast SSD storage and Thunderbolt 3 (USB-C) connectivity. And it all comes to life on a stunning 27-inch Retina 5K display with one billion colours and 500 nits of brightness that delivers vibrant images and razor-sharp text.', 3, 1),
(12, '27-inch iMac Pro with Retina 5K display ', 20855, 'Now everyone from video editors to 3D animators to musicians and software developers can turn big ideas into amazing work like never before. iMac Pro is powered by an Intel Xeon W processor with up to 18 cores for incredible performance. Its Radeon Pro Vega graphics chip lets you build and render amazingly lifelike special effects and VR worlds. And with up to 128GB of memory and 4TB of flash storage, saving and loading projects happen almost instantly. Introducing iMac Pro, the most powerful Mac ever.', 3, 1);

